import React from 'react';
import Button from '@mui/material/Button';

const CreateNote =() =>{
    return(
        <>
           <div className='main'>
               <form>
                  <input type='text' placeholder='Title'/> 
                  <textarea placeholder='Write a Note... ' rows="20" columns="5" />
                  <Button className="butn">+</Button>
               </form>
           </div>
        </>
    );
};

export default CreateNote;
